import { BrowserRouter, Route, Routes } from "react-router-dom";
import App from "./components/App";
import Body from "./components/Body";

function Main(){
    return(
        <>
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={<App />}>
                        <Route index element={<Body />}/>
                        <Route path="about" element={<AboutMe />}/>
                    </Route>
                </Routes>
            </BrowserRouter>
        </>
    )
}

export default Main;
